import React from 'react'




const Project = () => {

  return (
    <div>
      <h1>Some of My Projects</h1>
      <div className='wrapper-img'>

        <a target="_blank" class="ui medium image" href="https://tania2.vercel.app/">
          <img src="/images/tania.png" /></a>
      </div>

    </div>
  )
}

export default Project;
